import logo from "./logo.svg";
import Navigation from "./components/navigation.jsx";
import ImageLinkForm from "./components/imageLinkForm.jsx";
import Rank from "./components/Rank.jsx";
import Particles from "react-particles-js";
import "tachyons";
function App() {
  return (
    <div className="App">
      <Particles
        params={{
          particles: {
            number: {
              value: 100,
            },
            size: {
              value: 3,
            },
          },
          polygon: {
            enable: true,
            type: "inside",
            move: {
              radius: 10,
            },
            url: "./../assets/brain.svg",
          },
          interactivity: {
            events: {
              onhover: {
                enable: true,
                mode: "repulse",
              },
            },
          },
        }}
      />
      <Navigation />
      <Rank />
      <ImageLinkForm />
    </div>
  );
}

export default App;
